    constructor(string memory name_, string memory symbol_, uint256 maxSupply_, uint256 salt_) {
        _name = name_;
        _symbol = symbol_;
        _maxSupply = maxSupply_;
        _currentIndex = _startTokenId(); 
        _salt = salt_;   
        _DCFperBlock = 2e18;   
        _startBlockNumber = block.number;    
    }

  

    function BlockScore(address user)public view returns(uint256){
        uint256 difference = block.number.sub(_BlockScore[user][1]);
        uint256 Product = balanceOf(user).mul(difference);
        uint256 accumulation = _BlockScore[user][2].add(Product);
        return accumulation;
    }

    function updateBlockScore(address user)private{
        uint256 accumulation = BlockScore(user);       
        _BlockScore[user][2]= accumulation;       
        _BlockScore[user][1] = block.number;
    }



    function MineStatus (uint256 _BlockNumber)public view returns (uint256){
        uint256 a = _DCFperBlock.mul(1e18);   
        uint256 b = _BlockNumber.mul(1e18).div(_startBlockNumber);
        uint256 c = a.div(b);
        return c;    
    }

    function setPower (uint256 tokenId)internal view returns(uint256){
        uint _power = tokenId.mul(_salt).add(tokenId);        
        if(_power%10 == 0){
            _power = 1;
        }else{
            _power = _power%10;
        }
    }


   

